      ThreadSnapshot finalSnapshot=snapshot;
      if (timeRanges.stream().filter(t -> finalSnapshot.getTime() >= t.getStart() && finalSnapshot.getTime() <= t.getEnd()).findFirst().isPresent()) {
        data.add(snapshot);
      }
    }
    return data;
  }
